import{_ as A,c as s,o as a,f as i,af as e,ag as n,ah as t,ai as l,aj as p,ak as h}from"./chunks/framework.BG74BkEs.js";const G=JSON.parse('{"title":"Аудио","description":"","frontmatter":{},"headers":[],"relativePath":"ru/guide/audio.md","filePath":"ru/guide/audio.md","lastUpdated":1698833889000}'),d={name:"ru/guide/audio.md"},c=e+" 1x",o=n+" 1x",r=t+" 1x",k=l+" 1x",g=p+" 1x",B=h+" 1x",m=i('<h1 id="аудио" tabindex="-1">Аудио <a class="header-anchor vp-link" href="#аудио" aria-label="Permalink to &quot;Аудио&quot;">​</a></h1><p>В данной статье рассматриваются фоновая музыка (BGM) и звуковые эффекты (SFX); для голосов см. <a href="/naninovel-docs/ru/guide/voicing" class="vp-link">руководство по озвучиванию</a>.</p><p>Чтобы добавить, отредактировать или удалить ресурсы BGM и SFX, используйте диспетчер аудиоресурсов, доступный через <code>Naninovel -&gt; Resources -&gt; Audio</code>. Вы можете использовать любые аудиоформаты, <a href="https://docs.unity3d.com/Manual/AudioFiles.html" class="vp-link" target="_blank" rel="noreferrer">поддерживаемые Unity<span class="external-link-icon"> ↗</span></a>.</p><div class="imgit-picture" style="display:flex;" data-imgit-container><picture style="width:100%;"><source srcset="'+c+'" type="image/avif"><source srcset="'+o+`"><img data-imgit-loadable alt="" width="720" height="317" loading="lazy" decoding="async"></picture><picture class="imgit-cover" style="width:100%;margin-left:-100%;"><source srcset="data:image/avif;base64," type="image/avif"><img src="//:0" alt="cover" width="720" height="317" decoding="sync"></picture></div><p>Если у вас много аудиофайлов и их неудобно назначать через меню редактора, можно просто поместить их в папку <code>Resources/Naninovel/Audio</code>, и они автоматически будут доступны в скриптах. Вы можете дополнительно организовать их с помощью вложенных папок, если хотите; в этом случае используйте слеш (<code>/</code>) при ссылке на них в скриптах naninovel. Например, аудиоклип по адресу: <code>Resources/Naninovel/Audio/Music/Ambient/Noise002.wav</code> можно объявить в скрипте как <code>Music/Ambient/Noise002</code>.</p><p>Также можно использовать <a href="/naninovel-docs/ru/guide/resource-providers#адресация" class="vp-link">систему адресируемых ассетов</a>, чтобы вручную распределить ресурсы. Чтобы предоставить доступ к ассету, назначьте адрес, равный пути, который вы использовали бы для его объявления с помощью метода, описанного выше, за исключением опущенной части &quot;Resources/&quot;. Например, для объявления BGM &quot;MainTheme.wav&quot; назначьте ассету следующий адрес:<code>Naninovel/Audio/MainTheme</code>. Имейте в виду, что адресируемый провайдер по умолчанию не используется в редакторе; вы можете разрешить его, включив свойство <code>Enable Addressable In Editor</code> в меню конфигурации провайдера ресурсов.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Ассеты аудио, не объявленные через диспетчер ресурсов, не будут доступны в различных выпадающих меню редактора, как например, в том, что используется для выбора <code>Message Sound</code> для актора персонажа.</p></div><p>Поведение воспроизводимого звука можно настроить с помощью контекстного меню <code>Naninovel -&gt; Configuration -&gt; Audio</code>; доступные параметры см. в разделе <a href="/naninovel-docs/ru/guide/configuration#аудио" class="vp-link">Руководство по конфигурации</a>.</p><h2 id="фоновая-музыка" tabindex="-1">Фоновая музыка <a class="header-anchor vp-link" href="#фоновая-музыка" aria-label="Permalink to &quot;Фоновая музыка&quot;">​</a></h2><p>Используйте команду <a href="/ru/api/#bgm" target="_blank"><code>@bgm</code></a>, за которой следует название трека, чтобы управлять воспроизведением музыки в скриптах Naninovel:</p><div class="language-nani vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">nani</span><pre class="shiki shiki-themes theme-light theme-dark vp-code"><code><span class="line"><span style="--shiki-light:#ACB5C6;--shiki-dark:#5D6470;">; Начать проигрывать зацикленный трек с названием \`Sanctuary\`</span></span>
<span class="line"><span style="--shiki-light:#257DC8;--shiki-dark:#6CB2ED;">@bgm</span><span style="--shiki-light:#9250BF;--shiki-dark:#E2BE7F;"> Sanctuary</span></span>
<span class="line"></span>
<span class="line"><span style="--shiki-light:#ACB5C6;--shiki-dark:#5D6470;">; То же самое, что выше, но в начале используется фейд в 10 секунд, и трек проигрывается только один раз</span></span>
<span class="line"><span style="--shiki-light:#257DC8;--shiki-dark:#6CB2ED;">@bgm</span><span style="--shiki-light:#9250BF;--shiki-dark:#E2BE7F;"> Sanctuary</span><span style="--shiki-light:#C642A5;--shiki-dark:#CD9769;"> fade:</span><span style="--shiki-light:#9250BF;--shiki-dark:#E2BE7F;">10</span><span style="--shiki-light:#C642A5;--shiki-dark:#CD9769;"> loop:</span><span style="--shiki-light:#9250BF;--shiki-dark:#E2BE7F;">false</span></span>
<span class="line"></span>
<span class="line"><span style="--shiki-light:#ACB5C6;--shiki-dark:#5D6470;">; Изменить громкость всех воспроизводимых музыкальных треков до 50% за 2,5 секунды и зациклить их</span></span>
<span class="line"><span style="--shiki-light:#257DC8;--shiki-dark:#6CB2ED;">@bgm</span><span style="--shiki-light:#C642A5;--shiki-dark:#CD9769;"> volume:</span><span style="--shiki-light:#9250BF;--shiki-dark:#E2BE7F;">0.5</span><span style="--shiki-light:#C642A5;--shiki-dark:#CD9769;"> loop:</span><span style="--shiki-light:#9250BF;--shiki-dark:#E2BE7F;">true</span><span style="--shiki-light:#C642A5;--shiki-dark:#CD9769;"> time:</span><span style="--shiki-light:#9250BF;--shiki-dark:#E2BE7F;">2.5</span></span></code></pre></div><p>Музыкальные треки по умолчанию зациклены. Если название трека не указано в команде <a href="/ru/api/#bgm" target="_blank"><code>@bgm</code></a>, то командой будут затронуты все проигрываемые в данный момент треки. При вызове трека, который уже воспроизводится, воспроизведение не будет затронуто (трек не начнет воспроизводиться с самого начала), но будут применены указанные параметры (громкость, зацикливание).</p><p>Можно воспроизвести вступление трека, за которым следует зацикленная часть, используя параметр <code>intro</code>, например:</p><div class="language-nani vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">nani</span><pre class="shiki shiki-themes theme-light theme-dark vp-code"><code><span class="line"><span style="--shiki-light:#ACB5C6;--shiki-dark:#5D6470;">; Проиграть \`BattleThemeIntro\` один раз, а затем сразу же зацикленный \`BattleThemeMain\`.</span></span>
<span class="line"><span style="--shiki-light:#257DC8;--shiki-dark:#6CB2ED;">@bgm</span><span style="--shiki-light:#9250BF;--shiki-dark:#E2BE7F;"> BattleThemeMain</span><span style="--shiki-light:#C642A5;--shiki-dark:#CD9769;"> intro:</span><span style="--shiki-light:#9250BF;--shiki-dark:#E2BE7F;">BattleThemeIntro</span></span></code></pre></div><p>Чтобы остановить воспроизведение музыки, используйте команду <a href="/ru/api/#stopbgm" target="_blank"><code>@stopBgm</code></a>, за которой следует название трека. Если название трека не указано, команда остановит все воспроизводимые в данный момент треки.</p><div class="language-nani vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">nani</span><pre class="shiki shiki-themes theme-light theme-dark vp-code"><code><span class="line"><span style="--shiki-light:#ACB5C6;--shiki-dark:#5D6470;">; Затухание трека \`Promenade\` в течение 10 секунд и остановка воспроизведения</span></span>
<span class="line"><span style="--shiki-light:#257DC8;--shiki-dark:#6CB2ED;">@stopBgm</span><span style="--shiki-light:#9250BF;--shiki-dark:#E2BE7F;"> Promenade</span><span style="--shiki-light:#C642A5;--shiki-dark:#CD9769;"> fade:</span><span style="--shiki-light:#9250BF;--shiki-dark:#E2BE7F;">10</span></span>
<span class="line"></span>
<span class="line"><span style="--shiki-light:#ACB5C6;--shiki-dark:#5D6470;">; Остановить все играющие в данный момент музыкальные треки</span></span>
<span class="line"><span style="--shiki-light:#257DC8;--shiki-dark:#6CB2ED;">@stopBgm</span></span></code></pre></div><h2 id="звуковые-эффекты" tabindex="-1">Звуковые эффекты <a class="header-anchor vp-link" href="#звуковые-эффекты" aria-label="Permalink to &quot;Звуковые эффекты&quot;">​</a></h2><p>Используйте команды <a href="/ru/api/#sfx" target="_blank"><code>@sfx</code></a> и <a href="/ru/api/#stopsfx" target="_blank"><code>@stopSfx</code></a>, за которыми следует название клипа, чтобы управлять воспроизведением звуковых эффектов в сценариях Naninovel:</p><div class="language-nani vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">nani</span><pre class="shiki shiki-themes theme-light theme-dark vp-code"><code><span class="line"><span style="--shiki-light:#ACB5C6;--shiki-dark:#5D6470;">; Однократно воспроизвести SFX под названием \`Explosion\`</span></span>
<span class="line"><span style="--shiki-light:#257DC8;--shiki-dark:#6CB2ED;">@sfx</span><span style="--shiki-light:#9250BF;--shiki-dark:#E2BE7F;"> Explosion</span></span>
<span class="line"></span>
<span class="line"><span style="--shiki-light:#ACB5C6;--shiki-dark:#5D6470;">; Зацикленно воспроизводить SFX \`Rain\`</span></span>
<span class="line"><span style="--shiki-light:#257DC8;--shiki-dark:#6CB2ED;">@sfx</span><span style="--shiki-light:#9250BF;--shiki-dark:#E2BE7F;"> Rain</span><span style="--shiki-light:#C642A5;--shiki-dark:#CD9769;"> loop:</span><span style="--shiki-light:#9250BF;--shiki-dark:#E2BE7F;">true</span></span>
<span class="line"></span>
<span class="line"><span style="--shiki-light:#ACB5C6;--shiki-dark:#5D6470;">; Изменить громкость всех воспроизводимых треков SFX до 75% за 2,5 секунды и отключает зацикливание для всех них</span></span>
<span class="line"><span style="--shiki-light:#257DC8;--shiki-dark:#6CB2ED;">@sfx</span><span style="--shiki-light:#C642A5;--shiki-dark:#CD9769;"> volume:</span><span style="--shiki-light:#9250BF;--shiki-dark:#E2BE7F;">0.75</span><span style="--shiki-light:#C642A5;--shiki-dark:#CD9769;"> loop:</span><span style="--shiki-light:#9250BF;--shiki-dark:#E2BE7F;">false</span><span style="--shiki-light:#C642A5;--shiki-dark:#CD9769;"> time:</span><span style="--shiki-light:#9250BF;--shiki-dark:#E2BE7F;">2.5</span></span></code></pre></div><p>Треки звуковых эффектов по умолчанию не зациклены. Если название трека не указано в команде <a href="/ru/api/#sfx" target="_blank"><code>@sfx</code></a>, то командой будут затронуты все проигрываемые в данный момент треки. При вызове трека, который уже воспроизводится, воспроизведение не будет затронуто (трек не начнет воспроизводиться с самого начала), но будут применены указанные параметры (громкость, зацикливание).</p><p>Чтобы остановить воспроизведение звукового эффекта (вне зависимости, зациклен тот или нет), используйте команду <a href="/ru/api/#stopsfx" target="_blank"><code>@stopSfx</code></a>, за которой следует название трека. Если название трека не указано, команда остановит все воспроизводимые в данный момент треки.</p><div class="language-nani vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">nani</span><pre class="shiki shiki-themes theme-light theme-dark vp-code"><code><span class="line"><span style="--shiki-light:#ACB5C6;--shiki-dark:#5D6470;">; Затухание и остановка трека \`Rain\` в течение 15 секунд</span></span>
<span class="line"><span style="--shiki-light:#257DC8;--shiki-dark:#6CB2ED;">@stopSfx</span><span style="--shiki-light:#9250BF;--shiki-dark:#E2BE7F;"> Rain</span><span style="--shiki-light:#C642A5;--shiki-dark:#CD9769;"> fade:</span><span style="--shiki-light:#9250BF;--shiki-dark:#E2BE7F;">15</span></span>
<span class="line"></span>
<span class="line"><span style="--shiki-light:#ACB5C6;--shiki-dark:#5D6470;">; Остановить все играющие в данный момент треки звуковых эффектов</span></span>
<span class="line"><span style="--shiki-light:#257DC8;--shiki-dark:#6CB2ED;">@stopSfx</span></span></code></pre></div><h2 id="аудиомикшер" tabindex="-1">Аудиомикшер <a class="header-anchor vp-link" href="#аудиомикшер" aria-label="Permalink to &quot;Аудиомикшер&quot;">​</a></h2><p>Naninovel использует ассет <a href="https://docs.unity3d.com/Manual/AudioMixer.html" class="vp-link" target="_blank" rel="noreferrer">аудиомикшера<span class="external-link-icon"> ↗</span></a> при воспроизведении аудио для разделения каналов BGM, SFX и голосовой озвучки.</p><div class="imgit-picture" style="display:flex;" data-imgit-container><picture style="width:100%;"><source srcset="`+r+'" type="image/avif"><source srcset="'+k+'"><img data-imgit-loadable alt="" width="628" height="348" loading="lazy" decoding="async"></picture><picture class="imgit-cover" style="width:100%;margin-left:-100%;"><source srcset="data:image/avif;base64," type="image/avif"><img src="//:0" alt="cover" width="628" height="348" decoding="sync"></picture></div><p>В меню конфигурации аудио можно назначить пользовательский ассет микшера, изменить группы, используемые для каждого аудиоканала, и контроллеры регулировки громкости (имена открытых параметров). Если пользовательские ассеты микшера не назначены, то по умолчанию будет использоваться стандартный.</p><div class="imgit-picture" style="display:flex;" data-imgit-container><picture style="width:100%;"><source srcset="'+g+'" type="image/avif"><source srcset="'+B+'"><img data-imgit-loadable alt="" width="720" height="380" loading="lazy" decoding="async"></picture><picture class="imgit-cover" style="width:100%;margin-left:-100%;"><source srcset="data:image/avif;base64," type="image/avif"><img src="//:0" alt="cover" width="720" height="380" decoding="sync"></picture></div><p>Чтобы воспроизвести звук через пользовательскую группу в микшере, укажите путь к группе параметром <code>group</code>, доступным в командах <a href="/ru/api/#bgm" target="_blank"><code>@bgm</code></a>, <a href="/ru/api/#sfx" target="_blank"><code>@sfx</code></a> и <a href="/ru/api/#voice" target="_blank"><code>@voice</code></a>.</p><div class="language-nani vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">nani</span><pre class="shiki shiki-themes theme-light theme-dark vp-code"><code><span class="line"><span style="--shiki-light:#ACB5C6;--shiki-dark:#5D6470;">; Воспроизвести зацикленное аудио `Noise` через группу микшера `Master/Ambient`.</span></span>\n<span class="line"><span style="--shiki-light:#257DC8;--shiki-dark:#6CB2ED;">@sfx</span><span style="--shiki-light:#9250BF;--shiki-dark:#E2BE7F;"> Noise</span><span style="--shiki-light:#C642A5;--shiki-dark:#CD9769;"> loop:</span><span style="--shiki-light:#9250BF;--shiki-dark:#E2BE7F;">true</span><span style="--shiki-light:#C642A5;--shiki-dark:#CD9769;"> group:</span><span style="--shiki-light:#9250BF;--shiki-dark:#E2BE7F;">Master/Ambient</span></span>\n<span class="line"></span>\n<span class="line"><span style="--shiki-light:#ACB5C6;--shiki-dark:#5D6470;">; Воспроизвести голосовое аудио `ScaryVoice` через группу микшера `Master/Reverb`.</span></span>\n<span class="line"><span style="--shiki-light:#257DC8;--shiki-dark:#6CB2ED;">@voice</span><span style="--shiki-light:#9250BF;--shiki-dark:#E2BE7F;"> ScaryVoice</span><span style="--shiki-light:#C642A5;--shiki-dark:#CD9769;"> group:</span><span style="--shiki-light:#9250BF;--shiki-dark:#E2BE7F;">Master/Reverb</span></span></code></pre></div><p>Группы извлекаются с помощью метода <code>FindMatchingGroups(groupPath)</code> текущего назначенного ассета аудиомикшера; см. <a href="https://docs.unity3d.com/ScriptReference/Audio.AudioMixer.FindMatchingGroups" class="vp-link" target="_blank" rel="noreferrer">документацию Unity<span class="external-link-icon"> ↗</span></a> для получения дополнительной информации об ожидаемом формате пути. В случае, если несколько групп связаны с предоставленным путем, использоваться для воспроизведения звука будет первая из них.</p><p>В скриптах C# используемый в настоящее время аудиомикшер можно получить с помощью <a href="/naninovel-docs/ru/guide/engine-services" class="vp-link">сервиса движка</a> <code>IAudioManager</code>.</p><div class="language-csharp vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">csharp</span><pre class="shiki shiki-themes theme-light theme-dark vp-code"><code><span class="line"><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">var</span><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;"> audioManager</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> =</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> Engine.</span><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">GetService</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">&lt;</span><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">IAudioManager</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">&gt;();</span></span>\n<span class="line"><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">var</span><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;"> audioMixer</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> =</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> audioManager.AudioMixer;</span></span></code></pre></div>',32),u=[m];function C(y,E,v,b,F,f){return a(),s("div",null,u)}const _=A(d,[["render",C]]);export{G as __pageData,_ as default};
